function onChange(control, oldValue, newValue, isLoading) {
   if (isLoading || newValue == '') {
      return;
   }

var branchName = g_form.getValue('branch_name');

	if(branchName === "master"){
	alert("Please change the branch name as you cannot commit to the master branch.");
		g_form.setValue('branch_name', "");
	}
}
